import React from 'react'

let gateId = (note) => {
    return note.id
}

let getTitle = (note) => {
    return note.title
}


const ListItem = ({note}) => {
    return (
        <div className = "search-list-item">
            <h3>{getId(note)}</h3>
            <p>{getTitle(note)}</p>
        </div>
    )
}

export default ListItem
